import React, { useState, useEffect } from "react";
import ResultCard from "../component/ResultCard";
import Card from "semantic-ui-react";
import { TRIPSARRAY } from "./DummyData";

const HasilPengajuan = (props) => {
  const [filterdTrips, setFilterdTrips] = useState([]);

  async function prepareFilteredTrips(arrayToBeFiltered, wordparam) {
    const filtered = await arrayToBeFiltered.filter((anObject) => {
      return (
        anObject.pickup_location
          .toLowerCase()
          .indexOf(wordparam.toLowerCase()) > -1 ||
        anObject.dropoff_location
          .toLowerCase()
          .indexOf(wordparam.toLowerCase()) > -1 ||
        anObject.type.toLowerCase().indexOf(wordparam.toLowerCase()) > -1 ||
        anObject.driver_name.toLowerCase().indexOf(wordparam.toLowerCase()) >
          -1 ||
        anObject.car_make.toLowerCase().indexOf(wordparam.toLowerCase()) > -1 ||
        anObject.car_model.toLowerCase().indexOf(wordparam.toLowerCase()) >
          -1 ||
        anObject.car_number.toLowerCase().indexOf(wordparam.toLowerCase()) > -1
      );
    });
    return filtered;
  }
  useEffect(() => {
    prepareFilteredTrips(TRIPSARRAY, props.word).then((trip) => {
      setFilterdTrips(trip);
    });
  }, [props.word]);

  if (Array.isArray(filterdTrips) && filterdTrips.length) {
    return <div>{console.log(filterdTrips)}</div>;
  } else {
    return (
      <div>
        <span>no data</span>
      </div>
    );
  }
};

export default HasilPengajuan;
